import logo from './logo.svg';
import './App.css';
import React from 'react';


class Header extends React.Component {
render() {
    return (
            <div>

                  <header class="masthead">

                      <nav class="navi">
                          <ul class="navi-list">
                              <li><a style="text-align: center;font-size: 18px; color: white;" href="index.html">Home</a></li>
                              <li><a style="text-align: center;font-size: 18px; color: white;" href="#">About</a></li>
                              <li class="centered-logo">
                              <a href="index.html">
                      <h2 class="mt-3 logo" style="text-align: center;font-size: 25px; color: white;">J&J Media Co.</h2>
                              </a>
                              </li>
                              <li><a style="text-align: center;font-size: 18px; color: white;" href="https://calendly.com/ijosuedavi/photography-shoot">Book</a></li>
                            <li><a style="text-align: center;font-size: 18px; color: white;" href="#">Contact</a></li>
                          </ul>
                      </nav>
                  <div class="container d-flex h-100 align-items-center">
                          <div class="mx-auto text-center">
                              <h1 class="mx-auto my-0 text-uppercase">Welcome To JJ Media</h1>
                              <h2 class="text-white-50 mx-auto mt-2 mb-5">Everyone has a story, and we wish to capture it!</h2>
                              <a class="btn btn-success js-scroll-trigger" href="#about">Get Started</a>
                          </div>
                      </div>
                  </header>

              </div>
    );
  }
}

export default Header;
